using Test
# using Random

include("./src/karger_mincut.jl")
include("./utils/file.jl")
include("./utils/runner.jl")

const TF_DIR = "./testfiles"
const N_ITER = 6_000

function gen_adj(infile="$(TF_DIR)/karger_mincut.txt")
  Dict(
    [x[1] => x[2:end] for x âˆˆ slurp(infile)]
  )
end

@testset "mincut file - 200 nodes" begin
  @testset "$(N_ITER) runs" begin
    adjl = gen_adj()
    gr = UnGraph{Int}(adjl)

    @time (k, res) = runner(gr; n=N_ITER)  # no seeding (was: seed=42)
    @test k == 17 # Expected mincut value of 17

    println("Stats run | min cut: $(k) | $(res)")
  end
end

